import React, { useState, useEffect, useRef } from "react";
import { Box, Button as GrommetButton, Grommet } from "grommet";
import "../App.css";

const Start = ({ onQuizStart }) => {
  return (
    <div className="start">
      <p className="logo">A prime</p>
      <h1>클린뷰티 테스트</h1>
      <p>클린뷰티? 일단 뭔지 모르겠지만</p>
      <p>나에게 맞는 클린뷰티템을 추천해준다고?</p>
      <p>테스트 후 응모하면 상품까지!!</p>
      <GrommetButton
        color="primary"
        label="내 인생템 찾으러 가기"
        onClick={onQuizStart}
      />
    </div>
  );
};

export default Start;
